import React, { useState, useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import './Sidebar.css';

function Sidebar({ setIsAuthenticated }) {
  const navigate = useNavigate();
  const location = useLocation();
  const [active, setActive] = useState(location.pathname);

  useEffect(() => {
    setActive(location.pathname);
    console.log('setIsAuthenticated:', setIsAuthenticated);

  }, [location]);

  const handleNavigation = (path) => {
    navigate(path);
  };

  const handleLogout = () => {
    const token = localStorage.getItem('token'); // 토큰을 먼저 가져옴
    
    fetch('http://localhost:8080/api/auth/logout', {
        method: 'POST',
        headers: { 
            'Authorization': `Bearer ${token}`, // 토큰을 헤더에 포함
            'Content-Type': 'application/json'
        },
        credentials: 'include' // 쿠키 인증이 필요하다면 추가
    })
    .then(response => {
        if (response.ok) {
            console.log('if 문 내부 진입');
            localStorage.removeItem('token');
            setIsAuthenticated(false);
            console.log('로그아웃 성공, 인증 상태 업데이트됨');
            navigate('/');
            console.log('메인 페이지로 리다이렉트됨');
        } else {
            console.error('Failed to logout');
        }
    })
    .catch(error => {
        console.error('Logout error: ', error);
    });
  };

  return (
    <div className="sidebar">
      <h1 className="logo-title">
        <span>Energy</span>
        <i className="fas fa-bolt logo-icon"></i>
        <span>Save</span>
      </h1>
      <ul className="sidebar-menu">
        <li
          className={active === '/home' ? 'active' : ''}
          onClick={() => handleNavigation('/home')}>
          <i className="fas fa-home"></i> Home
        </li>
        <li
          className={active === '/calendar' ? 'active' : ''}
          onClick={() => handleNavigation('/calendar')}>
          <i className="fas fa-calendar-alt"></i> Calendar
        </li>
        <li
          className={active === '/map' ? 'active' : ''}
          onClick={() => handleNavigation('/map')}>
          <i className="fas fa-map"></i> Map
        </li>
        <li
          className={active === '/dailyquest' ? 'active' : ''}
          onClick={() => handleNavigation('/dailyquest')}>
          <i className="fas fa-list-ul"></i> DailyQuest
        </li>
        <li
          className={active === '/settings' ? 'active' : ''}
          onClick={() => handleNavigation('/settings')}>
          <i className="fas fa-cogs"></i> Settings
        </li>
        <li
          className="sidebar-item" 
          onClick={handleLogout}>
          <i className="fas fa-sign-out-alt"></i> Logout
        </li>
      </ul>
    </div>
  );
}

export default Sidebar;


